import Chart from "../Chart/Chart";

function ExpensesChart(props) {
  const chartDataPoints = [
    { label: "Jan", value: 0 },
    { label: "Feb", value: 0 },
    { label: "Mar", value: 0 },
    { label: "Apr", value: 0 },
    { label: "May", value: 0 },
    { label: "Jun", value: 0 },
    { label: "Jul", value: 0 },
    { label: "Aug", value: 0 },
    { label: "Sep", value: 0 },
    { label: "Oct", value: 0 },
    { label: "Nov", value: 0 },
    { label: "Dec", value: 0 },
  ];

  for (i = 0; i<12; i++) {
    const expenseMonth = i.date.getMonth(); //Starting at 0 => Jan
    chartDataPoints[expenseMonth].value += i.amount;
    console.log(chartDataPoints);
  }

  return <Chart dataPoints={chartDataPoints} />;
}

export default ExpensesChart;
